import { useEffect, useState } from 'react';
import { setConstantValue } from 'typescript';
import './App.css';

function App() {
  const [posts, setPosts] = useState([]);
  const [value, setValue] = useState([]);

  console.log('Pai renderizou!');

  //component did mount

  useEffect(() => {
    setTimeout(function () {
      fetch('https://jsonplaceholder.typicode.com/posts')
        .then((r) => r.json())
        .then((r) => setPosts(r));
    }, 5000);
  });

  return (
    <div className="App">
      <p>
        <input type="search" value={value} onChange={(e) => setConstantValue(e.target.value)} />
      </p>
      {posts.length > 0 && posts.map((post) => <Post key={post.id} post={post} />)}
      {posts.length <= 0 && <p> Ainda n√£o existem posts.</p>}
    </div>
  );
}

export default App;
